import React from 'react';
import JobList from './JobList';
import UploadResume from './UploadResume';
import Profile from './Profile';

export default function JobSeekerDashboard({ user }){
  return (
    <div>
      <JobList user={user} />
      <Profile user={user} />
      <UploadResume />
    </div>
  );
}
